		 this.checkboxhandleChange = this.checkboxhandleChange.bind(this);
		 this.checkboxhandleChange2 = this.checkboxhandleChange2.bind(this);
         this.state = {
			 id:0,
            title: "" ,
           studies : "", 
		   holisticData : [],
		   tagsData : [],
		   countryData : [],
		   cityData : [],
		   redirect:false,  
           profilepic:null,
