				  })
			} 




fileChangedCloseHandlerID4 = event => {
			
				
				this.setState({
					fileactivityimage3: null
				  })

				this.setState({
					deleteactivityimage3: true
				  })

			} 


			fileChangedCloseHandlerID41 = event => {
			
				
				this.setState({
					activityimage3: null
				  })

				this.setState({
					deleteactivityimage3: true
				  })
			} 



			fileChangedCloseHandlerID5 = event => {
			
				
				this.setState({
					fileactivityimage4: null
				  })

				this.setState({
